ads.description:
Wykupiony po leasingu w 2012 (przebieg przy zakupie ok. 160000km.). Od tego czasu użytkowany przez jednego użytkownika. Wykonywane wszystkie bieżące naprawy i serwisy filtrów oraz oleju. W 2024r. wymienione: 

- wtryski na używane sprawne testowane przez profesjonalną firmę;

- pasek rozrządu z rolkami;

- kompresor klimatyzacji;

- przewody układu hamulcowego (przód, tył);



Przed wystawieniem samochodu na sprzedaż:

- wszystkie pióra wycieraczek;

- silniczek tylnej wycieraczki;



Samochód w 100% sprawny, gotowy do jazdy. Ze względu na fakt, ze obecnie nikt nim nie jeździ do wykonania jest przegląd techniczny, ale zakładam, że potencjalny nabywca będzie chciał i tak sprawdzić samochód pod względem techniczno-mechanicznym, więc chętnie razem z nim wybiorę się na stacje diagnostyczną i pokryje koszt tego badania:). 



W przypadku dodatkowych pytań zapraszam do kontaktu.

Witam.



Sprzedam Chryslera Town Country z 2007 roku. Silnik 3,8 benzyna + gaz.

Silnik pracuje równo, nie bierze oleju, auto dobrze się prowadzi, niedawno wymienione hamulce przód i tył.

Auto jest dość dobrze wyposażone:

- klimatyzacja;

- skórzana tapicerka;

- elektrycznie otwierane drzwi boczne i klapa tylna;

- elektrycznie otwierane szyby z przodu, w drugim rzędzie i w trzecim rzędzie (uchylane);

- elektrycznie sterowane i podgrzewane lusterka;

- podgrzewane siedzenia przednie i w drugim rzędzie;

- elektryczna regulacja odległości pedałów;

- odtwarzacz z 3 ekranami (nigdy nie korzystałem);

-  stopnie (progi zewnętrzne);

- 17 calowe koła;

- hak;

- duża butla gazowa w bagażniku;

Auto do drobnej naprawy blacharskiej/lakierniczej. Niedawno wystąpił błąd czujnika prędkości w skrzyni biegów (po kilku kilometrach, skrzynia włącza tryb awaryjny - auto jedzie na 2 biegu oraz na wstecznym). Autem można się więc poruszać na niewielkie odległości. Z tego powodu samochód sprzedaję jako uszkodzony.

Po więcej informacji proszę o kontakt pod numerem 6.0.0x2x7x2x7-9-8
